description:
1992 - Mother Love Bone (also known as Stardog Champion)  is a compilation album which contains material from the EP Shine (1989) and the album Apple (1990). It was released after the band dissolved due to the death of vocalist Andrew Wood.

Tracks: 

1.	&quot;This Is Shangrila&quot;
2.	&quot;Stardog Champion&quot;
3.	&quot;Holy Roller&quot;
4.	&quot;Bone China&quot;
5.	&quot;Come Bite the Apple&quot;
6.	&quot;Stargazer&quot;
7.	&quot;Heartshine&quot;
8.	&quot;Captain Hi-Top&quot;
9.	&quot;Man of Golden Words&quot;
10.	&quot;Capricorn Sister&quot;
11.	&quot;Gentle Groove&quot;
12.	&quot;Mr. Danny Boy&quot;
13.	&quot;Crown of Thorns&quot; 

