14.	&quot;Thru Fade Away&quot;
15.	&quot;Mindshaker Meltdown&quot;
16.	&quot;Half Ass Monkey Boy&quot;
17.	&quot;Chloe Dancer/Crown of Thorns&quot;		
18.	&quot;Capricorn Sister&quot; (Shine version)
19.	&quot;Lady Godiva Blues&quot;
